import React, {Fragment} from 'react';
import Form from '../component/form';
import Checkbox from "./checkbox";

export default ({onSubmit, initialValues}) => (
  <Fragment>
    <Form
      fields={{
        username: {type: 'text', required: true, label: 'Saisissez votre identifiant',empty_message:'Merci de saisir votre Identifiant'},
        password: {type: 'password', required: true, label: 'Saisissez votre mot de passe',empty_message:'Merci de saisir votre mot de passe'}
      }}
      buttons={{
        confirm: {type: 'confirmation', label: 'Se connecter'}
      }}
      initialValues={initialValues}
      submitText="Se connecter"
      subscibeText="demande de souscription"
      buttons={{
        submit: {label: 'Valider'},
      }}
      onSubmit={onSubmit}
    />
    <div className="form-remember mt-3">
      <Checkbox label="Se souvenir de moi"/> <br />
      <a href='#' className="a link_subscribe">
        Demande de souscription
      </a>
    </div>
  </Fragment>

)
